// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Vote {

  struct Candidates{

      uint candid;
      uint votes;
  }

  Candidates[] internal total_Candidates;
  bool election_state_open = true;
  constructor(uint[] memory ids) {
    for(uint i=0; i<ids.length;i++){
      total_Candidates.push(Candidates(ids[i],0));
    }
  }
  function vote(uint id)public {
    bool empty = true;
    require(election_state_open,"Sorry Voting is Closed");
    for(uint i=0;i< total_Candidates.length;i++){
      if (total_Candidates[i].candid==id){
          total_Candidates[i].votes++;
          empty=false;
          break;

      }
    }

    require(!empty,"Candidates does not exist");

  }

  function get_State()public view returns ( uint[] memory votes, uint[] memory candids){

  uint len = total_Candidates.length;
  votes = new uint[](len);
  candids = new uint[](len);

    for(uint x=0; x<len;x++){
      votes[x] = total_Candidates[x].votes;
      candids[x] = total_Candidates[x].candid;
    }

    return(votes,candids);
  }
}
